// src/pages/DoctorsPage.jsx
import { useEffect, useState } from "react";
import axiosInstance from "../api";
import { getAuthHeader } from "../auth";

export default function DoctorsPage() {
  const [doctors, setDoctors] = useState([]);

  useEffect(() => {
    fetchDoctors();
  }, []);

  const fetchDoctors = async () => {
    const res = await axiosInstance.get("doctors/", { headers: getAuthHeader() });
    setDoctors(res.data);
  };

  return (
    <div>
      <h1 className="text-2xl font-bold mb-4">Doctors</h1>
      <table className="table-auto w-full bg-white rounded-lg shadow">
        <thead>
          <tr>
            <th className="px-4 py-2">ID</th>
            <th className="px-4 py-2">Name</th>
            <th className="px-4 py-2">Specialization</th>
          </tr>
        </thead>
        <tbody>
          {doctors.map((doc) => (
            <tr key={doc.id} className="text-center border-t">
              <td className="px-4 py-2">{doc.id}</td>
              <td className="px-4 py-2">{doc.name}</td>
              <td className="px-4 py-2">{doc.specialization}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
